                    <li>
                        <form>
                            <h2>Input Username</h2>
                            <h2>Input Password</h2>
                        </form>
                    </li>
                </ul> */}
                <form>
                    <ul>
                        <li><h2>Input Username</h2></li>
                        <li><input /></li>
                    </ul>
                    
                    
                    <h2>Input Password</h2>
                    <input />
                    <Button>Login</Button>
                </form>
            </div>
        )
    }
}

export default Login;
